import classNames from "classnames";
import styles from "./styles.module.css";

export const EditPackagePopup = ({ togglePopup }) => {
  return (
    <div className={styles.popup_wrapper}>
      <div className={styles.popup}>
        <button
          className={classNames(styles.button, styles.popup_closeButton)}
          type="button"
          onClick={() => togglePopup()}
        />
        <h2 className={styles.title}>Форма покупки лицензии</h2>
        <form className={styles.content}>
          <div className={styles.package}>
            <div className={styles.input_container}>
              <input
                type="radio"
                id="start"
                className={styles.input_radio}
              ></input>
              <label htmlFor="start">Start</label>
            </div>
            <input type='date' id='dateStart'></input>
            <label htmlFor="dateStart"></label>
            <input type='date' id="dateEnd"></input>
            <label htmlFor="dateEnd"></label>
          </div>
        </form>
      </div>
    </div>
  );
};
